import React, { Component } from 'react';
import './style/jobList.css';


const list = ["tarjeta1", "tarjeta2", "tarjeta3", "tarjeta4"];

class JobList extends Component {

    render() {
        return (
            <div>
                <div className="row">
                  list.map()
                </div>
            </div>
        )
    }

}

export default JobList;
